      SELECT ALL col0 AS col0 FROM tab1 WHERE NOT NULL IS NULL GROUP BY col0 HAVING + 33 * + + col0 / CAST ( NULL AS INTEGER ) * - + 19 IS NOT NULL;
  - name: tab1

